import React from 'react';


export const Home = () => {
    return (
        <div className="container">
            <div className="row">
                <div className="col-md-6 offset-md-3 col-sm-12">
                    <h1 className="text-center">Mongo chat</h1>
                </div>
            </div>
        </div>
    )
}
